import React from "react";
import './Login.css'
import 'bootstrap/dist/css/bootstrap.min.css';

const Login = () => {
  const logoBK = require('./../../assets/Image/logoBK.png')
  const google = require('./../../assets/Image/google-icon.png')
  return (
    <div
      className="login_bg"
      style={{
        backgroundImage:
          'url("https://hcmut.edu.vn/img/carouselItem/07531069.jpg?t=07531113")',
      }}
    >
      <div className="container h-100">
        <div className="row justify-content-center align-items-center h-100">
          <div className="col-lg-6">
            <div className="card bg-white rounded-3">
              <div className="card-body">
                <div className="text-center">
                  <img
                    src={logoBK}
                    alt="logo_BK"
                    className="logo_BK rounded-circle"
                  />
                </div>
                <div className="mt-4 mb-4 text-center">
                  <div className="mb-3">
                    Bạn chưa có tài khoản? Đăng kí ngay!
                  </div>
                  <div className="login_using_google">
                    <img
                      src={google}
                      alt="google"
                      className="google rounded-circle"
                    />
                    Đăng nhập bằng Google
                  </div>
                </div>
              </div>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Login;
